import { Avatar, Grid, List, TextField } from '@material-ui/core';
import React from 'react';
import nikklaus from './nikklaus.jpg'
const Posts = () => {
    return (
        <Grid container style={{marginTop:
        '20px'}}>     
           
       <Grid item sm={1} >
       <Avatar  style={{height:'60px', width:'60px', marginLeft:'20px',marginTop:'20px'}} alt="Remy Sharp" src={nikklaus}  /> 
       </Grid>
       <Grid item sm={6} >
       <TextField style={{marginTop:'20px',width:'400px'}} id="filled-basic" label="Whats on your mind dawg?" variant="filled" />
       </Grid>

      </Grid>
     );
}
 
export default Posts;
